const newsArticlesContainer = document.getElementById("news");

window.onload = () => {
  fetchLocalStorage().forEach(newsArticle => {
    const { timestamp, photo, title, text } = JSON.parse(newsArticle);
    const newsArticleHTML = getNewsArticleHTML(
      timestamp,
      photo,
      title,
      text,
      true
    );
    newNewsArticleToDOM(newsArticleHTML);
  });
  fetchDB();
};

const fetchLocalStorage = () => {
  let news = Object.keys(localStorage)
    .filter(key => key.startsWith("news-"))
    .map(key => localStorage[key]);
  return news;
};

