const newNewsArticleToDOM = newsArticleHTML => {
  newsArticlesContainer.insertAdjacentHTML("beforeend", newsArticleHTML);
};

const getNewsArticleHTML = (
  timestamp,
  photo,
  title,
  text,
  isPending = false
) => {
  const date = getDateFromTimestamp(timestamp);
  const newNewsArticle = `
  <div class="card mx-2 my-2${
    isPending ? " bg-warning" : ""
  }" style="width: 18rem;">
            <div class="card-img-wrap">
              <img
                class="card-img-top"
                src="${photo}"
                alt="${title}"
              />
            </div>
            <div class="card-body text-white">
              <h5 class="card-title">
                ${title}
              </h5>
              <span class="news-date">${date}</span>
              <p class="card-text">
                ${text}
              </p>
            </div>
          </div>
  `;

  return newNewsArticle;
};
